import React, {Component} from 'react';
import './App.css';
import Navigation from './components/Navigation/Navigation.js';
import Data from './components/Data/Data.js';

class App extends Component {
	render() {
		return (
			<div className="App">
			<Navigation />
			<Data />
			</div>
		);
	}
}

export default App;
